The annual neighborhood bakeoff is today and the mother's in the neighborhood have brought out their best dishes. Christian, a bakery owner and his assistant Michael are the judges for the event, which is being held at Deauxma's house. Right before the judging, Christian has an emergency and he makes Michael the sole judge of the event. After fending off a couple of bribery attempts, last year's winner Julia Ann arrives with a flourish. She knows Michael from her daughter, and she decides to make sure she wins again......but will the other mom's find out?
